import React from "react";
import Main from "./Main";
import Footer from "./Footer";
import Nav from "./Nav";
import { Link } from "react-router-dom";

const Home = ({ cards }) => {
  return (
    <>
      <Link to="/" className="nav-link">
        Home
      </Link>
      <Nav />
      <Main cards={cards} />
      <Footer />
    </>
  );
};

export default Home;
